import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../../assets/styles/logincss/header.css';

function Dummy() {
  const [dummyData, setdummyData] = useState([]);

  useEffect(() => {
    document.title = 'Logo';

    return () => {
      document.title = 'Default Title';
    };
  }, []);

  useEffect(() => {
    axios.get('http://localhost:9000/api/dummydata')
      .then((response) => {
        console.log('Data received:', response.data);
        setdummyData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      {dummyData.map((item) => (
        <div key={item.id}>
          {/* <img src={`data:image/jpg;base64, ${item.profile}`} alt="" /> */}
          <button className="my_profile_img_button">
          <img id="my_profile_img" className="clickable-image" alt="" src={`data:image/jpg;base64, ${item.profile}`} onClick={toggleDropdown} />
        </button>
        <div class="dropdown_main">
          <ul class="dropdown" id="dropdownList">
            <li>User name</li>
            <li>My Profile</li>
            <li>Dashboard Filter</li>
            <li>Logout</li>
            <li>Dayout/Logout</li>
          </ul>
        </div>
        </div>
      ))}
    </div>
  );
}

export default Dummy;
